const arrayProductos = [
    {
        id: "1",
        nombre : "producto 1",
        stock : 5,
        descripcion : "El producto mas vendido de la tienda"
    },
    {
        id: "2",
        nombre : "producto 2",
        stock : 35,
        descripcion : "El segundo producto mas vendido de la tienda "
    }
]

export default arrayProductos;
